import React, { useState } from 'react';

function StatusService() {
  const [bookingId, setBookingId] = useState('');
  const [status, setStatus] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Send the booking ID to a backend API to retrieve the status of the booking
    // Replace the following line with an actual API call to retrieve the status
    const randomStatus = Math.random() < 0.5 ? 'Pending' : 'Confirmed';
    setStatus(randomStatus);
  };

  return (
    <>
    <div>
      <h1>Booking Status</h1>
      <form onSubmit={handleSubmit}>
        <label htmlFor="bookingId">Booking ID:</label>
        <input type="text" id="bookingId" value={bookingId} onChange={(e) => setBookingId(e.target.value)} />

        <button type="submit">Check Status</button>
      </form>

      {status && (
        <div>
          <h2>Status: {status}</h2>
        </div>
      )}
    </div>
    </>
  );
}
export default StatusService
